import PropTypes from 'prop-types';
import classNames from 'classnames';

class Gallery extends React.Component {
  render() {
    return (
      <section className='gallery'>
        <img src='/static/bg_gallery_1.png' className='gallery-image' alt='' />
        <img src='' className='gallery-image' alt='' />
        <img src='' className='gallery-image' alt='' />
        <img src='' className='gallery-image' alt='' />
        <img src='/static/bg_gallery_5.png' className='gallery-image' alt='' />
        <style jsx>{`
          .gallery {
            grid-area: gallery;
            display: grid;
            grid-template-column: 1fr 1fr 1fr 1fr;
            grid-template-row: 1fr 1fr 1fr;
          }
        `}</style>
      </section>
    )
  }

}

export default Gallery
